$(window).scroll(function () {
  var sc = $(window).scrollTop();

  if (sc > 100) {
    $("#header-sroll").addClass("small-header");
  } else {
    $("#header-sroll").removeClass("small-header");
  }
});

function smallMenu() {
  if ($(window).width() < 1600) {
    $('body').addClass('sidebar-xs');
  } else {
    $('body').removeClass('sidebar-xs');
  }
}

