$(document).ready(function () {
  $('#checkAll').change(function () {
    if (false == $(this).prop("checked")) {
      $(".checkRows").prop('checked', false);
      $(".selectedClass").removeClass('success');
      $('.custom_action_box').hide();
    } else {
      $(".checkRows").prop('checked', true);
      $(".selectedClass").addClass('success');
      $('.custom_action_box').show();
    }
  });
  $(document).on('click', '.checkRows', function () {
    var inc = 0;
    var rowId = $(this).val();

    if (false == $(this).prop("checked")) {
      $('#append-' + rowId).removeClass('success');
    } else {
      $('#append-' + rowId).addClass('success');
    }

    $('.checkRows:checkbox:checked').each(function (i) {
      inc++;
    });

    if (inc == 0) {
      $('.custom_action_box').hide();
    } else {
      $('.custom_action_box').show();
    }

    var numberOfChecked = $('.checkRows:checkbox:checked').length;
    var totalCheckboxes = $('.checkRows:checkbox').length;

    if (totalCheckboxes > numberOfChecked) {
      $('#checkAll').prop('checked', false);
    }
  });
  $(document).on('click', '#deleteButtonTagFeedback', function () {
    var val = [];
    $('.checkRows:checkbox:checked').each(function (i) {
      val[i] = $(this).val();
    });

    if (val.length === 0) {
      alert('Please select a row.');
    } else {
      var elem = $(this);
      swal({
        title: "Are you sure? You want to delete this record!",
        text: "You will not be able to recover this record!",
        type: "warning",
        showCancelButton: true,
        confirmButtonColor: "#EF5350",
        confirmButtonText: "Yes, delete it!",
        cancelButtonText: "No, cancel pls!",
        closeOnConfirm: true,
        closeOnCancel: true
      }, function (isConfirm) {
        if (isConfirm) {
          $('.overlaynew').show();
          $.ajax({
            url: "/admin/tags/deleteMultipalTagGroupEntity",
            type: "POST",
            data: {
              multiTagId: val
            },
            dataType: "json",
            success: function success(data) {
              if (data.status == 'success') {
                $('.overlaynew').hide();
                window.location.href = '';
              }
            }
          });
        }
      });
    }
  });
  $(document).on('click', '.deleteTagGroupEntity', function () {
    var elem = $(this);
    deleteConfirmationPopup("This record will deleted immediately.<br>You can't undo this action.", function () {
      $('.overlaynew').show();
      var tagID = $(elem).attr('tagid');
      var groupID = $(elem).attr('groupid');
      $.ajax({
        url: "/admin/tags/deleteTagGroupEntity",
        type: "POST",
        data: {
          id: tagID,
          _token: '{{ csrf_token() }}'
        },
        dataType: "json",
        success: function success(data) {
          if (data.status == 'success') {
            $('.overlaynew').hide();
            window.location.href = '';
          }
        }
      });
    });
  });
  $(document).on('click', '.editDataList', function () {
    $('.editAction').toggle();
  });
});

